import React, {useState, Component} from 'react'

export default class GetSheduleNew extends Component {
  constructor(props) {
      super(props);
      this.state = {
          data: this.props.date,
          items: []
      }
  }
  updateTask() {
    fetch('https://mypew.ru/php/table.php', {
        method: 'POST',
        header: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({
            table : 3,
            date : this.props.date,
            day_count: 1,
        })
    })
    .then (res => res.json())
    .then ((response) => {
        this.setState({
            items: response
        });
    })
  }
  componentDidMount() {
    this.updateTask();
    console.log(2);
  }
  componentDidUpdate() {
      console.log(1);
  }

  render() {
      const {items, data} = this.state;
      return (
          <ul>
              {this.updateTask()}
              {items.map(item => (
                  <li key={item.id}>
                    {item.title}
                  </li>
              ))}
          </ul>
      )
  }
}
